import React from 'react';
import {AppBar, Button, Toolbar} from '@material-ui/core';
import {Link} from 'react-router-dom';
import './Navbar.css';

class Footer extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        return (
          <div className="navbar">
              <Toolbar >
                <a path="/" to="https://github.com/lucaspingpao" target="_blank" style={{ textDecoration: 'none' }}><Button color="primary">Github</Button></a>
                <Link to="/coding" style={{ textDecoration: 'none' }}><Button color="primary">YouTube</Button></Link>
              </Toolbar>
          </div>
          );
    }
}

export default Footer;
